void* DM_GetKernelExportAddress(ULONGLONG kernelBaseAddress, const char* ntoskrnl_version, DWORD exportType)
{
	uint64_t currentVersionHash;

	currentVersionHash = compiletime_md5(ntoskrnl_version);
	for (int i = 0; OsOffsets[i].version != 0x00; i++)
	{
		if (currentVersionHash == OsOffsets[i].version)
		{
			switch (exportType)
			{
				case KE_ZwClose:
					return ((void*)(kernelBaseAddress + OsOffsets[i].zwclose));
				case KE_ZwOpenProcess:
					return ((void*)(kernelBaseAddress + OsOffsets[i].zwopenprocess));
				case KE_PsLookupProcessByProcessId:
					return ((void*)(kernelBaseAddress + OsOffsets[i].pslookupprocess));
				case KE_ZwDuplicateObject:
					return ((void*)(kernelBaseAddress + OsOffsets[i].zwduplicateobject));
				case KE_NtShutdownSystem:
					return ((void*)(kernelBaseAddress + OsOffsets[i].ntshutdownsystem));
				case KE_PsGetProcessPeb:
					return ((void*)(kernelBaseAddress + OsOffsets[i].psgetprocesspeb));
				case KE_memcpy:
					return ((void*)(kernelBaseAddress + OsOffsets[i].memcpy));
				case KE_MmCopyMemory:
					return ((void*)(kernelBaseAddress + OsOffsets[i].mmcopymemory));
				case KE_MmMapIoSpace:
					return ((void*)(kernelBaseAddress + OsOffsets[i].mmmapiospace));
				case KE_ZwReadVirtualMemory:
					return ((void*)(kernelBaseAddress + OsOffsets[i].zwreadvirtualmemory));
				case KE_ZwQueryVirtualMemory:
					return ((void*)(kernelBaseAddress + OsOffsets[i].zwqueryvirtualmemory));
				case KE_MiQueryAddressState:
					return ((void*)(kernelBaseAddress + OsOffsets[i].miqueryaddressstate));
				default:
					printf("[!] Fatal error on offsets retrieval: unknown export\n");
					exit(1);
			}
		}
	}
	printf("[!] Fatal error on offsets retrieval: unsupported kernel version\n");
	exit(1);
}

